I'm liking it! Great sound. Great Miller Remaster!

The Scarlet>Eyes>GDTRFB is superb. Eyes gets a little iffy on lyrics but well overlook that for excellent playing. This segue also has REAL transitions, not just STOP then GO. This show is proof for some in these uneven times. Generally I like later on in 85 a little better, but this show is special. Great setlist and arrangement of tunes. 

Phil is up, so is brent, i'm in!@}}
